There's life nearly comes to an end when she is hit by a car. Her fiance, Stuart, swears that he will never leave her side, but watching her fade away may be too much for him to handle. Theresa awakens months later to an empty seat next to her, and an empty spot in her heart. Will she be inspired to love again by the handsome doctor who treats her? Or by her best friends' loving marriage? Or by the hospital patient who is in the bed next to her? Will Theresa awaken to a life full of love or to a life without it? New Sensations presents a Romance Series movie about love lost &amp; love found -- Awakening to Love.

